        method: 'post',
        mode: 'no-cors',
        headers: {
          'Accept':'application/json',
          'Content-Type':'application/json',
        },
        body: JSON.stringify({
          'title': 'React Post Test 1',
          'body': 'React Post Body Test 1'
        })

      });
      console.log('Result' + result)

    }catch(e){
      console.log(e)
    }
  }

  render(){
    return(
    <div className="App">
      <h1>Hello</h1>
      <form onSubmit={()=> this.postData()}/>
      <button onClick ={()=> this.postData()}>Post Some Data!</button>
    </div>
    );
  }
}



export default App;
